		08FB7794FE84155DC02AAC07 /* LibmTestHarness */ = {
			isa = PBXGroup;
			children = (
				8BA5640F09BE6D8C00448B14 /* libmathCommon.dylib */,
				8BA5640D09BE6D1A00448B14 /* libmathCommon_debug.dylib */,
				8BA5640109BE6AA300448B14 /* libmCommon.a */,
				3B4A313909106DC400F23E7E /* libmCommon_debug.a */,
				08FB7795FE84155DC02AAC07 /* Source */,
				D206B46407A84F640013BA4B /* libmxKicker.c */,
				6EB1F68907553180004E75B6 /* libmx_i386.exp */,
				6EB1F68A07553180004E75B6 /* libmx_ppc.exp */,
				1AB674ADFE9D54B511CA2CBB /* Products */,
			);
			comments = "\nOverall organization of the Libm build process:\n\n\tThe current process is somewhat more complicated than we would like. The chief problem at the moment is that xcode does not have a facility\n\tfor  having source code files used for some architectures and not others. We have a lot of assembly code in here. So far it hasn't been practical\n\tto add #ifdef to the head and tail of all of them to control which architectures they are built for.   Instead what we do is build each of the architecture\n\tcomponents for each build project separately, then lipo them together in a build script. This process is further complicated due to the 3-way fragmentation\n\tof libm, because of various historical conflicts with other software. These fragments are libm (shipped as part of Libsystem), LibmCommon and libmx.\n\t\n\t\t3 way fragmentation * 4 flavors of libm * 4 architectures  = 48 different libm targets + master build targets and test suites to keep track of.\n\n\tThe math library currently supports four architectures: i386, ppc, x86-64 and ppc64\n\n\nBuild Targets and What They Do:\n\n\tLibm  --  this master build target builds the components to be included into libSystem:\n\n\t\t\t\t/usr/local/lib/system/libm.a\t\t\t/usr/local/lib/system/libmCommon.a\n\t\t\t\t/usr/local/lib/system/libm_debug.a\t\t/usr/local/lib/system/libmCommon_debug.a\n\t\t\t\t/usr/local/lib/system/libm_profile.a\t\t/usr/local/lib/system/libmCommon_profile.a\n\n\t\t\tand also the stand alone segments that go into libmCommon dylib variants\n\n\t\t\t\t/usr/lib/system/libmathCommon.A.dylib\n\t\t\t\t/usr/lib/system/libmathCommon.A_debug.dylib\n\t\t\t\t/usr/lib/system/libmathCommon.A_profile.dylib\n\n\t\t\tand associated links to these\n\n\t\t\t\t/usr/lib/system/libmathCommon.dylib\n\t\t\t\t/usr/lib/system/libmathCommon_debug.dylib\n\t\t\t\t/usr/lib/system/libmathCommon_profile.dylib\n\n\t\t\tIt also produces various libm<stuff>_static libraries which may or may not be used for anything. \n\n\t\tWhen building from xcode, these are placed in /tmp/LibmV5.roots/Libm~dst/\n\t\tWhen building from buildit, these are placed in /tmp/Libm.roots/Libm~dst/\n\n\t\tThe reasons for separating Libm into libm and libmCommon are murky, but are said to have to do with symbol collisions with Carbon when \n\t\t\tMacOS X was born as a result of the wicked and unnatural fusion of NextStep and MacOS 9.\n\n\t\tThe Libsystem project knits libm.a together with libc to produce the system /usr/lib/libSystem.B.dylib and associated debug and profile variants. \n\t\tRigorous build practice would require that after building libm (with buildit -merge=/) you then do a buildit with Libsystem, and replace the \n\t\tsystem libSystem.B.dylib with the build product. Reboot and test.   Turnaround for that is a little slow, so typically we just link test apps against\n\t\tthe appropriate _debug.a file in /tmp/LibmV5.roots/Libm~dst, and test that way. Build submissions should use the more rigorous method.\n\n\t\tLibm invokes about 40 subtargets during its build, one for each architecture for each .a and dylib that it produces.\n\t\tOnce those are done, it invokes a script to lipo the fragments together to make the 10 or so fat libraries that are the libm build product.\n\n\t\tLibm also installs the man pages in one of its copy files build stages. \n\n\tLibmx -- this build target builds libmx, which contains an odd collection of complex, float and long double precision APIs on ppc/ppc64.\n\n\t\t\t\t/usr/lib/libmx.A.dylib           \t \n\t\t\t\t/usr/lib/libmx.A_debug.dylib                    \n\t\t\t\t/usr/lib/libmx.A_profile.dylib  \n\n\t\t\tand links to those under the names:\n\n\t\t\t\t/usr/lib/libmx_debug.dylib   /usr/lib/libmx.dylib     /usr/lib/libmx_profile.dylib\n\n\t\t\tThe i386/x86-64 variants have no symbols. The intel symbols are all in libm, where they should be.\n\n\t\t\tThe reason why libmx exists is historical as well. When Tiger appeared, single, long double and complex were introduced. \n\t\t\tHowever, gcc3 had intrinsics in it already for these, which could not be removed before Tiger shipped. This created a collision.\n\t\t\tLibmx was created to resolve the collision. The symbols remain in libmx for backwards compatibility with apps compiled on \n\t\t\tTiger before GCC 4 became available.  Some of these have duplicate symbols in libm, which can cause a number of ugly headaches \n\t\t\tfor build tools and everyone. In addition, at some point in the process, the Tiger libSystem got back ported to Panther, meaning that\n\t\t\tMacOS X.3.9 also has 128-bit long doubles and some duplicate symbol wackyness. This created more problems. \n\n\t\t\tOne kludge to work around these problems means that libmx has a build dependency on the MacOS X.4u SDK, which may or may not\n\t\t\tbe installed by default.\n\n\t\t\tLibmx invokes about 16 other subtargets, which build the individual arch contributors to libm. The i386/x86-64 subtargets clearly\n\t\t\tdon't do much.  Once those are done, it invokes a script to lipo the fragments together and put the build products in the install \n\t\t\tlocation.\n\n\t\t\tWhy libmCommon is under the libm target but this isn't, we can't say. \n\n\n\tlibmx_STUBBED -- purpose unknown\n\tlibmx_OBSOLETE -- purpose unknown\n\n\tpublicHeaders -- runs a makescript that installs the math.h and fenv.h into the $DSTROOT/usr/include/\n\t\t\t\t\tSome parts of this activity appear to be redundant with one of the Libm CopyFiles build stages\n\n\tlibm_<arch>.a\t -- builds libm.a for that arch\n\tlibm_<arch>_debug.a\t -- builds libm_debug.a for that arch\n\tlibm_<arch>_profile.a\t -- builds libm_profile.a for that arch\n\tlibm_<arch>_static.a\t -- builds libm_static.a for that arch\n\tlibmCommon_<arch>.dylib\t -- builds libmCommon.A.dylib for that arch\n\tlibmCommon_<arch>_debug.dylib\t -- builds libmCommon.A_debug.dylib for that arch\n\tlibmCommon_<arch>_profile.adylib -- builds libmCommon.A_profile.dylib for that arch\n\tlibmCommon_<arch>_static.a -- builds libmCommon_static.a for that arch\n\n\tVectorTest<arch> -- legacy test code. Not maintained. \n\tLibmTestHarness -- legacy test code. Not maintained. \n\t\n\tlibmx_<arch>.dylib \t-- builds libmx.dylib for that arch \n\tlibmx_<arch>_debug.dylib \t-- builds libmx_debug.dylib for that arch \n\tlibmx_<arch>_profile.dylib \t-- builds libmx_profile.dylib for that arch \n\tlibmx_<arch>_static.a \t-- builds libmx_static.a for that arch \n\t\n\tTestSuite -- latest test suite. Samples a lot of edge cases for various functions. Source and test cases are in xmmLibm.subproj/TestSuite\n\tTiming Suite -- useful for measuring performance of Libm functions in cycles. Turns TestSuite test cases into timing cases.  ** Warning ** produces a lot of data!\n\t\t\t\t\t \nBuild Configurations:\n\n\tDevelopment -- debug symbols on, mostly -O0 (except profile targets) \n\tDeployment -- debug symbols vary, -O3  *** NOT ACTUALLY USED FOR DEPLOYMENT ***   Mostly useful for  speed testing.\n\tDefault -- this is what B&I uses to build libm for the system.\n\nQuickStart:\n\tTo build Libm, select Libm from that Active Target list, and click build.\n\tYou can set the current library version number by getting info on \"LibmV5\" in the Groups & Files list, select the build tab, and set \n\t\tLIBM_VERSION_NUMBER to the new number.\n\tTesting is most easily done by selecting Test Suite from the Active Target list, build and run.  You can edit  \n\t\txmmLibm.subproj/TestSuite/TLIST2.TEXT  to control which tests are run. \n\tThere are also some more thorough tests in vImageCrasher2, but they take a while to run\n\n\tTo build just Libm with buildit:\n\n\t\tsudo  ~rc/bin/buildit -arch ppc -arch i386 -arch ppc64 -arch x86_64 Libm\n\n\tTo build a full Libm + Libsystem:\n\n\t\t1) sudo  ~rc/bin/buildit -arch ppc -arch i386 -arch ppc64 -arch x86_64 Libm -merge=/\n\t\t2) sudo  ~rc/bin/buildit -arch ppc -arch i386 -arch ppc64 -arch x86_64 Libsystem\n\t\t3) sudo pax -rw Libsystem.roots/Libsystem~dst   /\n\t\t4) reboot and hope\n\n\t\tBoth stages 1 and 3 have the capacity to render your system inoperable. It is wise to have an alternative boot partition around in case of trouble.\n";
			name = LibmTestHarness;
			sourceTree = "<group>";
		};
